import React from 'react';

import classes from './Backdrop.module.css';

const backdrop = props => {
    let backdrop = null;
    if (props.show){
    backdrop =  <div onClick={props.clicked} className={classes.Backdrop}></div>;
    }
   return  backdrop;
}
export default backdrop;
